import React, { useState } from "react";
import Layout from "../../components/Layout";
import './style.css'
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';
import pic from '../../images/1.png';
import pic1 from '../../images/12.png';
import pic2 from '../../images/Aseri.png';
import pic3 from '../../images/1200-44-1200x44-3.png';
export default function HomePage() {
  return (
    <Layout>
      <Carousel>
                <div>
                    <img style={{width:'100%',height:'100%'}} src={pic1} alt="" />
                </div>
                <div>
                    <img src={pic2} alt=""/>

                </div>
                <div>
                    <img style={{width:'100%',height:'50%'}}src={pic} alt=""/>
                </div>
            </Carousel>
            <div>
            <img style={{width:'90%',height:'50%',padding}}src={pic3} alt=""/>
            </div>
    </Layout>
  );
}
